          tokenName: "EL",
          type: TokenTypes.CRYPTO,
          image: Token000,
          marketSize: 312312312333,
          totalBorrowed: 33231231323121233,
          depositApy: 2.93,
          borrowApr: 192
        },
        {
          tokenName: "ETH",
          type: TokenTypes.CRYPTO,
          image: Token001
        },
        {
          tokenName: "BNB",
          type: TokenTypes.CRYPTO,
          image: Token002,
          marketSize: 11323123213,
